DROP TABLE IF EXISTS `t_invoice_detail`;
CREATE TABLE `t_invoice_detail` (
  `fpqqlsh` varchar(20) NOT NULL COMMENT '请求流水号',
  `kpqd` char(1) DEFAULT NULL COMMENT '开票渠道1航信2百旺',
  `dsptbm` varchar(8) DEFAULT NULL COMMENT '平台编号',
  `nsrsbh` varchar(20) DEFAULT NULL COMMENT '开票方识别号',
  `nsrmc` varchar(100) DEFAULT NULL COMMENT '开票方名称',
  `nsrdzdah` varchar(20) DEFAULT NULL COMMENT '开票方电子档案号',
  `swjg_dm` varchar(11) DEFAULT NULL COMMENT '税务机构代码',
  `dkbz` char(1) DEFAULT NULL COMMENT '代开标志',
  `kpxm` varchar(100) DEFAULT NULL COMMENT '开票项目',
  `xhf_nsrsbh` varchar(20) DEFAULT NULL COMMENT '销货方识别号',
  `ddh` varchar(20) DEFAULT NULL COMMENT '订单号',
  `xhfmc` varchar(100) DEFAULT NULL COMMENT '销货方名称',
  `xhf_dz` varchar(80) DEFAULT NULL COMMENT '销货方地址',
  `xhf_dh` varchar(20) DEFAULT NULL COMMENT '销货方电话',
  `thf_yhzh` varchar(100) DEFAULT NULL COMMENT '销货方银行账号',
  `ghfmc` varchar(100) DEFAULT NULL COMMENT '购货方名称',
  `ghf_sj` varchar(100) DEFAULT NULL COMMENT '购货方手机',
  `ghf_email` varchar(50) DEFAULT NULL COMMENT '购货方邮箱',
  `ghfqylx` varchar(2) DEFAULT NULL COMMENT '购货方企业类型（01企业02机关事业单位03个人04其他）',
  `kpy` varchar(8) DEFAULT NULL COMMENT '开票员',
  `kplx` char(1) DEFAULT NULL COMMENT '开票类型（1正票2红票）',
  `tschbz` char(1) DEFAULT NULL COMMENT '特殊冲红标志0 正常冲红(电子发票)',
  `czdm` varchar(2) DEFAULT NULL COMMENT '操作代码10 正票正常开具11 正票错票重开,20 退货折让红票 ，21错票重开红票 22 换票冲红 ',
  `qd_bz` char(1) DEFAULT NULL COMMENT '清单标志',
  `qdxmmc` varchar(100) DEFAULT NULL COMMENT '清单发票项目名称',
  `kphjje` double(11,6) DEFAULT NULL COMMENT '价税合计金额',
  `hjbhsje` double(11,6) DEFAULT NULL COMMENT '合计不含税金额',
  `hsbz` varchar(1) DEFAULT NULL COMMENT '含税标识',
  `hjse` double(11,6) DEFAULT NULL COMMENT '合计税额',
  `fp_dm` varchar(12) DEFAULT NULL COMMENT '发票代码',
  `fp_hm` varchar(8) DEFAULT NULL COMMENT '发票号码',
  `sl` varchar(8) DEFAULT NULL,
  `xmmc` varchar(100) DEFAULT NULL COMMENT '项目名称',
  `xmdj` double(11,6) DEFAULT NULL COMMENT '项目单价',
  `fphxz` varchar(1) DEFAULT NULL COMMENT '发票行性质 0 正常行 1折扣行 2 被折扣行 ',
  `xmsl` double(8,0) DEFAULT NULL COMMENT '项目数量',
  `spbm` varchar(19) DEFAULT NULL,
  `status` char(1) DEFAULT NULL COMMENT '状态（0处理中，1成功，2失败）',
  `pdfurl` varchar(200) DEFAULT NULL COMMENT 'pdfurl',
  `create_time` varchar(20) DEFAULT NULL COMMENT '创建时间',
  `update_time` varchar(20) DEFAULT NULL COMMENT '更新时间',
  `app_id` varchar(32) DEFAULT NULL COMMENT 'appId 来源标识',
  PRIMARY KEY (`fpqqlsh`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='发票明细表';

